import React from 'react';
import Friends from './FriendsElement';
import styles from './friends.module.css';

const FriendsList = ({ friends }) => (
    <ul class="friend-list">
        {friends.map((friend) => (
            <li key={friend.id}>
                < Friends
                    avatar={friend.avatar}
                    name={friend.name}
                />
            </li>
        ))}
    </ul>);

export default FriendsList;
